			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# \n# Script to append development information to the QS version string\n#\n# The format of the appended version string is as follows:\n#\n# Debug build from branch \"testBranch\": \t\t\tß66:testBranch:Debug\n# Release build from branch \"testBranch\": \t\tß66:testBranch\n# Release build from branch \"master\" or \"release\":\tß66 \n#\n# As described in http://groups.google.com/group/quicksilver---development/browse_thread/thread/b12b53d7680b3c3f\n#\n# Created by Henning Jungkurth on Apr 18 2012\n\nCURRENT_BRANCH=`git branch --no-color 2> /dev/null | sed -e '/^[^*]/d' -e 's/* \\\\(.*\\\\)/\\\\1/'`\n\nNEW_VERSION_STRING=\"\"\nif [ $CONFIGURATION == \"Debug\" ] ; then\n\tNEW_VERSION_STRING=\"$QS_INFO_VERSION:$CURRENT_BRANCH:$CONFIGURATION\"\nelse\n\tif [ $CURRENT_BRANCH != \"master\" ] && [ $CURRENT_BRANCH != \"release\" ] ; then\n\t\tNEW_VERSION_STRING=\"$QS_INFO_VERSION:$CURRENT_BRANCH\"\n\tfi\nfi\n\nif [ -n \"$NEW_VERSION_STRING\" ] ; then\n\tdefaults write $QS_APP_CONTENTS_FOLDER/Info CFBundleShortVersionString \"\\\"$NEW_VERSION_STRING\\\"\"\nfi";
		};
